import React, { useEffect } from 'react';
import Coordinate from '../models/Coordinate';
import styles from './Map';
import { Map as Mapp, TileLayer, Polygon, CircleMarker, Circle, Popup } from 'react-leaflet';

type MapProps = {
  initialLocation: Coordinate;
  polygon: Array<Coordinate>;
};

const center = [51.505, -0.09];

const polygon = [
  [51.515, -0.09],
  [51.52, -0.1],
  [51.52, -0.12],
];

const multiPolygon = [
  [
    [51.51, -0.12],
    [51.51, -0.13],
    [51.53, -0.13],
  ],
  [
    [51.51, -0.05],
    [51.51, -0.07],
    [51.53, -0.07],
  ],
];

const Map = ({ initialLocation }: MapProps): JSX.Element => {
  return (
    <Mapp center={position} zoom={this.state.zoom}>
      <TileLayer
        attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
      <Marker position={position}>
        <Popup>
          A pretty CSS3 popup. <br /> Easily customizable.
        </Popup>
      </Marker>
    </Mapp>
  );
};

export default Map;
